import React from 'react';
import service1 from './image/voiture-prise-charge-atelier.jpg'

const Services = () => {
    return (
        <div>
            <h1>Nos services</h1>
            <div className="services">
                <p>Le service numéro 1</p>
                <img src={service1} className="service1" />
            </div>
        </div>
    );
};

export default Services;
